import './swipertest.css'

import { Col, Container, Row } from "react-bootstrap";

function SwiperTest(){

    const ArraysOfSwiper = [{}];
    const ArrayOfSwiperOnMap = ArraysOfSwiper.map((ArrayOfSwiper) =>
    <Col key = {ArrayOfSwiper.id} lg = "4" md = "6" sm = "12" className = "swiper-wrapper">
        <img src = {ArrayOfSwiper.image} className = "w-100 h-100"/>
        <div className = "swiper-content">

        </div>
    </Col>
    )

    return(
        <Container fluid>
            <Row>
                {ArrayOfSwiperOnMap}
            </Row>
        </Container>
    )
}
export default SwiperTest
